text_show:
Ua faasilasila aloaia mai e le ofisa o le Komesina o faigapalota le tatala ai nei o avanoa e faaulu ai talosaga a i latou e agavaa mo le Faiga Palota muamua (Pre-Polling) e faasauni ai mo le faigapalota laitiiti mo le itumalo faapalota o Gagaifomauga Nu. 2.
O taeao, Aso Toonai, 7 o Me 2022 lea e amata ai ona tatala lea avanoa mo talosaga ae faaiu i le Aso Lulu, 18 Me 2022, ae o le faigapalota autū e faia i le Aso Faraile, 3 Iuni 2022.
O loo ta’ua mai ai foi i lea faasilasila vaega e tatau ai ona agavaa tagata mo le faigapalota muamua, e aofia ai:
- Tagata e malaga atu i atunuu mamao i le vaiaso a’o lumanai le faigapalota laitiiti (3 Iuni 2022);
- Tagata ua atoa le 65 tausaga agai i luga;
- Tagata e iai manaoga tumau;
- Tagata o loo avea ma tausi matua poo se tagata e filifili e le tagata e iai manaoga tumau.
